            label1.Size = new Size(811, 69);
            label1.TabIndex = 20;
            label1.Text = "지적 호기심이 매우 크며, 끊임없이 배우고자 합니다.\r\n새로운 기술, 철학, 과학 등 다양한 분야에 관심을 가지며, 한 번 빠진 분야에서는 전문가 수준까지 성장할 수 있습니다.\r\n이들에게 학습은 경쟁이 아닌 자기 충족의 수단입니다.";
