            label3.Name = "label3";
            label3.Size = new Size(672, 69);
            label3.TabIndex = 18;
            label3.Text = "전략가는 감정보다 논리를 우선시하며, 자신의 감정을 잘 드러내지 않습니다.\r\n하지만 감정이 없는 것이 아니라, 감정이 판단을 흐리지 않도록 조심스럽게 다루기 때문입니다.\r\n내면적으로는 깊은 감수성을 지니고 있으며, 실수나 갈등 상황에서는 후회와 반성을 하기도 합니다.";
