            label5.Size = new Size(876, 69);
            label5.TabIndex = 16;
            label5.Text = "INTJ는 스스로에 대한 확신이 매우 강한 편입니다.\r\n타인의 의견보다 자신이 수집한 정보와 논리적 판단에 더 무게를 두기 때문에, 때로는 독단적이거나 무신경하게 보일 수 있습니다.\r\n하지만 그 중심에는 흔들림 없는 가치관과 명확한 목표가 존재합니다.";
