            label8.Size = new Size(827, 46);
            label8.TabIndex = 14;
            label8.Text = "이들은 단순한 이상을 좇기보다는, 그 이상을 현실로 바꾸는 방법을 모색하는 데 집중합니다. \r\n'사용 가능한 아이디어'를 선호하며, 철저한 분석과 논리를 통해 실현 가능한 계획을 세우고 그것을 끝까지 밀고 나갑니다.";
